import React, { useState } from "react";
import styles from "./Header.module.scss";
import { useNavigate } from "react-router-dom";

const Header = () => {
  // states 
  const navigate = useNavigate()
  
  return (
    <div className={styles.header}>
       <div className={styles.header_logo}>
        <h3 className={styles.logo_title}>Logo</h3>
      </div>
      <div className={styles.header_menu}>
      <ul className={styles.menu_list}>
        <li className={styles.menu_item} onClick={() => navigate("/")}>Home</li>
        <li className={styles.menu_item} onClick={() => navigate("/skills/")}>Experience</li>
        <li className={styles.menu_item} onClick={() => navigate("/projects/")}>Projects</li>
        <li className={styles.menu_item} onClick={() => navigate("/contact/")}>Contact</li>
      </ul>
      </div>
  </div>
  );
};

export default Header;
